import React from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";
import styles from "./styles.module.css";

const BarGraph = ({ data }) => {
  return (
    <BarChart
      width={450}
      height={300}
      data={data}
      margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 5,
      }}
      barSize={20}
      className={styles.graphContainer}
    >
      <XAxis dataKey="name" scale="point" padding={{ left: 5, right: 5 }} />
      <YAxis />
      <Tooltip />
      <Legend />
      <CartesianGrid />
      <Bar dataKey="pv" fill="#43bfe5" />
    </BarChart>
  );
};

export default BarGraph;
